import React from 'react';
import './home-page.scss';

import Header from '../components/header/Header.component';
import Cover from '../components/cover/Cover.component';

const Home = () => {
    return (
        <div className="home-page">
            <Header />
            <Cover />
        </div>
    )
}

export default Home;
